import React from 'react';
import { Handle, Position } from 'react-flow-renderer';

const nodeColors = {
  Customer: '#4CAF50',
  'Counter-Party': '#2196F3',
  Business: '#FFC107',
  Transfer: '#9C27B0',
  BillPay: '#FF5722',
  PhoneNumber: '#00BCD4',
  Address: '#795548',
};

const BaseNode = ({ type, color, data }) => (
  <div
    style={{
      background: color,
      padding: 10,
      borderRadius: '50%',
      width: 100,
      height: 100,
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
      color: 'white',
    }}
  >
    <Handle type="target" position={Position.Top} style={{ background: '#555' }} />
    <div style={{ fontSize: '12px' }}>{type}</div>
    <div style={{ fontSize: '14px', fontWeight: 'bold' }}>{data.displayName}</div>
    <Handle type="source" position={Position.Bottom} style={{ background: '#555' }} />
  </div>
);

const TransactionNode = ({ type, color, data }) => (
  <div
    style={{
      background: color,
      padding: 10,
      borderRadius: 5,
      width: 150,
      height: 50,
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
      color: 'white',
    }}
  >
    <Handle type="target" position={Position.Top} style={{ background: '#555' }} />
    <div style={{ fontSize: '12px' }}>{type}</div>
    <div style={{ fontSize: '14px', fontWeight: 'bold' }}>{data.displayName}</div>
    <Handle type="source" position={Position.Bottom} style={{ background: '#555' }} />
  </div>
);

const InfoNode = ({ type, color, data }) => (
  <div
    style={{
      background: color,
      padding: 5,
      borderRadius: 5,
      width: 120,
      height: 40,
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
      color: 'white',
      fontSize: '12px',
    }}
  >
    <Handle type="target" position={Position.Top} style={{ background: '#555' }} />
    <div>{type}</div>
    <div style={{ fontSize: '10px' }}>{data.displayName}</div>
    <Handle type="source" position={Position.Bottom} style={{ background: '#555' }} />
  </div>
);

const nodeTypes = {
  Customer: (props) => <BaseNode {...props} type="Customer" color={nodeColors.Customer} />,
  'Counter-Party': (props) => <BaseNode {...props} type="Counter-Party" color={nodeColors['Counter-Party']} />,
  Business: (props) => <BaseNode {...props} type="Business" color={nodeColors.Business} />,
  Transfer: (props) => <TransactionNode {...props} type="Transfer" color={nodeColors.Transfer} />,
  BillPay: (props) => <TransactionNode {...props} type="BillPay" color={nodeColors.BillPay} />,
  PhoneNumber: (props) => <InfoNode {...props} type="Phone" color={nodeColors.PhoneNumber} />,
  Address: (props) => <InfoNode {...props} type="Address" color={nodeColors.Address} />,
};

export default nodeTypes;
